    const ctx = document.getElementById(data.metric + '-canvas').getContext('2d');
    new Chart(ctx, {
            type: 'line',
            data: data.data,
            options: {
                scales: {
                    y: {
                        beginAtZero: true,
                        title: {
                            display: true,
                            text: data.metric
                        }
                    }
                }
            }
        }
    )
};

            </script>
